import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import NavBar from './Nav';
import Login from './Login';
import Game from './game';
import Level from './Level';
import Register from './Register';
import Profile from './Profile';
import Leaderboard from './Leaderboards';
import Stats from './Stats';
import GameLevelTwo from './GameLevelTwo';
import { BackgroundProvider } from './BackgroundContext';

const App = () => {
  return (
    <Router>
      <BackgroundProvider>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          {/* Wrap the following routes in a common parent to apply a background color */}
          <Route
            path="/*"
            element={
              <div style={{ backgroundColor: '#0000', minHeight: '100vh' }}>
                <NavBar />
                <Routes>
                  <Route path="/levels" element={<Level />} />
                  <Route path="/game" element={<Game />} />
                  <Route path="/profile" element={<Profile />} />
                  <Route path="/leaderboard" element={<Leaderboard />} />
                  <Route path="/stats" element={<Stats />} />
                  <Route path="/gametwo" element={<GameLevelTwo />} />
                </Routes>
              </div>
            }
          />
        </Routes>
      </BackgroundProvider>
    </Router>
  );
};

export default App;
